import React from 'react'
import "./modals.css"
export default function Modal(props) {
if(!props.open){
    return null;
}
    return (<>
        <div className="overlay"></div>
        <div className="modal">
            {props.children}
            <button className="link-w">Close</button>
        </div>
        </>
    )
}
